import React, {Component} from 'react';

class Accueil extends Component {

    render() {
      return (
        <div id="container">
          <header>
            <img src="/img/logo.png" />
          </header>
          <h1>What is Quizultural ?</h1>
          <p>Quizultural is a project led by four students of different nationalities.
            The goal of Quizultural is to make quiz and with this we can learn with funny way local cultures.
              (thanks to Quizultural we can learn with funny way the local cultures.)
          </p>
          <h1>Create an account or sign in to play.</h1>
          <p>Le Lorem Ipsum est simplement du faux texte employé dans la composition et la mise en page avant impression. 
              Le Lorem Ipsum est le faux texte standard de l'imprimerie depuis les années 1500.
              (can make our quiz or play quiz)
          </p>
          <h2>Discover lot of cultures let's go !</h2>
          <button>Play</button>
        </div>
      );
    }
}

export default Accueil;
